import React from 'react'
import { Navigate } from 'react-router-dom';

function Logout({ resetToken }) {
    console.log(resetToken);
    resetToken();
    return (
        <div className='row'>
            <div className='col-12 text-center p-5'>
                <h1> Logout </h1>
            </div>
            <Navigate to="/" />
        </div>
    )
}

export default Logout
